// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.DeviceRouting) predicate.DeviceRouting {
	return predicate.DeviceRouting(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.DeviceRouting) predicate.DeviceRouting {
	return predicate.DeviceRouting(sql.NotPredicates(p))
}
